@Component
public class ApplicationStartup implements ApplicationListener<ApplicationReadyEvent>{
    
    @Override
    public void onApplicationEvent(ApplicationReadyEvent event) {
        
        String username = "admin";
        String imgtype = "image/png";
        String img = "";
        byte[] imgcontent = Base64.getDecoder().decode(img);
        MicroUsersApplication.adminDto = new UserTotalDTO();
        MicroUsersApplication.adminDto.setIdUser(0);
        MicroUsersApplication.adminDto.setImg(imgcontent);
        MicroUsersApplication.adminDto.setImgType(imgtype);
        MicroUsersApplication.adminDto.setUsername(username);
    }
    
}
